import{_ as t,o as r,c as s,a as e}from"./app.11717abc.js";const a="/assets/img/pushCode.png",f=JSON.parse('{"title":"二零一八年总结","description":"","frontmatter":{"updateTime":"2019/01/05","title":"二零一八年总结"},"headers":[],"relativePath":"ESSAY/summary-of-2018.md","lastUpdated":1675434496000}'),o={name:"ESSAY/summary-of-2018.md"},p=e('<div class="info custom-block"><p class="custom-block-title">二零一八年总结</p><p>这一年我参与了十多个项目<br> 撸了五万行代码，又默默删除了四万五千行<br> 早十点是收割八阿哥效率最高的时间，十分钟能胜一天<br> 最恐惧上下班时间点找我说话，一般没啥好事，而且会导致忘事<br> 喜欢和同事讨论大家都不懂的技术知识<br> 隔三差五地打开 GitHub，假装在造什么巨轮，但一年下来新博客还是只有首页<br> 双十一，我看着柜子中飘动的四件带格子衣服，觉得这是栅格设计被嘲讽得最惨的一天</p><p>二零一八年一月，也是特别的一个月<br> 这个月常常晚回家，做得像狗一样，汪汪汪，却得到像段子一样的结果<br> 二零一八年一月十日这天我把 JUST DO <strong>IT</strong> 的广告文案反复问候了一百零八次，深夜十二点后仍在问候</p><p>热衷分享朋友圈，收藏了许多美好回忆，和段子一样的生活片段<br> 朋友圈摄影大赛上，我是吐槽类选手中装逼最隐晦的，装逼类选手中最善于吐槽的<br> 从不设置三天可见，因为也没有多少人会去翻看三天前的我<br> 发广告的大部分屏蔽了，小部分发广告却还没被我屏蔽的都是真爱</p><p>全年奔波超过两万五千公里，平均每天花在路上的时间超过两小时<br> 车上的我是孤独的，无论有没有乘客，因为总是在听东西<br> 好不容易顺风车司机审核通过，没接几次单它就停止运营了，一个坐我车的美女都没有遇上</p><p>网易云为我整理的年度歌单中，从命运交响乐到闪闪的红星都赫然在列<br> 大数据AI分析不到原因，说我听歌风格成迷<br> 其实只是音乐APP被当成了起床闹铃<br> 深夜还在听的歌，才是真的在听，习惯边听边看评论，表情像在哭又像笑</p></div><p>2019 内部 Gitlab 上的代码提交：</p><p><img src="'+a+'" alt="内部 Gitlab 上的代码提交"></p>',3),_=[p];function c(i,n,b,m,d,l){return r(),s("div",null,_)}const S=t(o,[["render",c]]);export{f as __pageData,S as default};
